  input: 'TEXT,F3XN,,"Dear FEC:  Our Committee conducted intensive Educational and
    ''fundraising'' activities during March and April of 2003 designed to build support
    for our troops and especially emphasizie the leadership of President Bush.  For
    23 days during this period, various members of our Committee set up booths in
    parking lots and shopping malls and made available various yardsigns, buttons
    and patriotic stickers to citizens who made donations.  Because of the overwhelming
    interest these activities generated we raised  $42,406.31 in contributions.  These
    contributions were made in the form of checks ($8,622) and cash ($33,784.31).  Most
    of the contributions were in the $5.00 to $20.00 range and occurred in a high
    volume, fast paced environment at the various locations around the county.  This
    FECFILE itemizes all those contributions which were made via check since that
    gave us a ready mechanism for obtaining the name and adress of the contributor.  However,
    for the cash contributions it was impractical to obtain the name, address, employer
    or occupation of the contributors.  Therefore, this FECFILE contains the daily
    cash receipts shown under line 11 a ii as Unitemized contributions.  I believe
    that this procedure adheres to your Guidelines for reporting''Small Contributions
    Collected At a Fundraising Event''.  Our event was called ''Get Involved & Be
    Counted'' on the file."'
